import React from 'react';
import './AboutUs.css';


function AboutUs() {
  return (
    <div className="about-container">
      <h2>About Us</h2>
      <p>We are a team of beauty experts who believe that everyone deserves to look and feel their best. We offer a wide range of high-quality, cruelty-free cosmetics that are designed to enhance your natural beauty.</p>
      <p>Our mission is to provide our customers with the best possible shopping experience, from easy online ordering to fast and reliable shipping. We are committed to providing excellent customer service and are always happy to help with any questions or concerns.</p>
      <p>Thank you for choosing us as your go-to destination for all your beauty needs!</p>
    </div>
  );
}

export default AboutUs;
